import React, { useEffect } from "react";
import { useRouter } from "next/router";
import Cookies from "js-cookie";
const App = ({ children }) => {
  const userAddress = Cookies.get("loggedUserStatus");
  console.log("userAddress", userAddress);
  useEffect(() => {});
  return (
    <React.Fragment>
      <div>{children}</div>
    </React.Fragment>
  );
};

export default App;
